import React, {Component} from 'react';
import logo from './logo.png';
import  './App.css';
import Form from './Form'

class App extends Component {

    render(){
  return (
          <div  className="App">
            <header className="App-header">


                 <img src={logo} className="App-logo" alt="logo" width = {1000} height = {10}/>
          <br/>
          <br/>

           Enter the details here
          <br/>
          <br/>
               <Form />
          <br/>
          <br/>

              <p>
                Please produce an ID to the Lobby Host
              </p>

              <a
                className="App-link"
                href="https://reactjs.org"
                target="_blank"
                rel="noopener noreferrer"
              >
                Re-register
              </a>
            </header>
          </div>
  );
}
}
export default App;
